div.div:
&mram1x {
partitions {
/* Merged partition used by the MCUboot (variant 0). */
slot0_partition: partition@40000 { ... };
/* Area reserved for the MCUboot header (2048 bytes). */
/* Application code partition (variant 0). */
cpuapp_slot0_partition: partition@40800 { ... };
/* Radio code partition (variant 0). */
cpurad_slot0_partition: partition@92000 { ... };
/* Area reserved for the MCUboot trailer (TLVs, including digest and signature). Reserved by:
* "ipc_radio" in SB_CONFIG_MCUBOOT_IMAGES_ROM_END_OFFSET_AUTO
*/
/* Merged partition used by the MCUboot (variant 1). */
slot1_partition: partition@100000 { ... };
/* Area reserved for the MCUboot header (2048 bytes). */
/* Application code partition (variant 1). */ cpuapp_slot1_partition: partition@100800 { ... };
/* Radio code partition (variant 1). */
cpurad_slot1_partition: partition@152000 { ... };
/* Area reserved for the MCUboot trailer (TLVs, including digest and signature). Reserved by:
* "ipc_radio_secondary_app" in SB_CONFIG_MCUBOOT_IMAGES_ROM_END_OFFSET_AUTO
*/ };
};
